import React, { Component } from "react";
import about from './images/simonAboutImage.png';
import Butter from 'buttercms';
import '../butterclient';
import { Helmet } from "react-helmet"


const butter = Butter('2fa7babaa7064c23b2cb90171957b2add0333e77')



export default class ProductView extends React.Component {
  state = {
    data: {
      fields: {
        customer_logos: []
      }
    }
  }
  async componentDidMount () {
    const { match } = this.props
    const resp = await butter.page.retrieve('*', 'front-page')
    this.setState(resp.data)
  }
  render() {

    const { fields } = this.state.data
    console.log(fields.facebook_open_graph_title)
    console.log(fields.hero_image)



    return (

      <div>
        <Helmet>
          <title>{fields.seo_title}</title>
          <meta property='og:title' content={fields.facebook_open_graph_title} />
        </Helmet>
        <h1>{fields.headline}</h1>
        <img src={fields.hero_image} />
        console.
        <button>{fields.call_to_action}</button>
        <h3>Customers Love Us!</h3>
        <ul>
          {fields.customer_logos.map((logo) => {
            return (
              <li>
                <img src={logo.logo_image} />
              </li>
            )
          })}
        </ul>

      <div className="pageWrapper">        
        <div className="pageTopDivider"></div>

        <div className="text-center">
        <p className="headerPageText">My name is Simon!</p>
        <div className="siteShowCase">

            <img className="showCaseImage" scr={about} alt="Blaj" />
            <p>About Me</p>
        </div> 

        </div>
        <div className="divider"></div>
        <div className="divider"></div>
      </div>
      </div>
    );
  }
}
